import Card from './Card';

export default function Cards({characters}) {
   return <div className='container'>
      {characters.map((value, i) => {
         return <Card id={i} key={i} name={value.name} image={value.image} status={value.status} gender={value.gender} origin={value.origin.name}/>
      })}
   </div>;
}
